import React,{Component} from 'react'
import PosteData from '../data/posts.json'

function PostList () {
  return (
    <div>
      <h1>hello my first react page</h1>
      {PosteData.map((postdetail,index)=>{
          return <h1>{postdetail.title}</h1>
      })}
    </div>
  );
}

export default PostList;
